var powerSource = global.get("powerSource")
var driveTime = global.get("driveTime")
var connectionType = global.get("connectionType")
var gpioPin = global.get("gpioPin")
var gpioSubPin = global.get("gpioSubPin")
var loraId = global.get("loraId")
var loraRelayNo = global.get("loraRelayNo")
var deviceTag = global.get("deviceTag")
var objectData = null
var twoDot = ':'
var minus = '-'

if (deviceList == 'F:' && fanType == '') {
    global.set("errorCase", 'fanTypeError');
    objectData = 'Fan type unselected';

} else if (deviceList == 'M:' && driveTime == ''){
    global.set("errorCase", 'driveTimeError');
    objectData = 'Motor drive time undefined';

} else if (connectionType == 'G:' && gpioPin == ''){
    global.set("errorCase", 'gpioSelectError');
    objectData = 'GPIO Pin unselected';

} else if (deviceList == 'M:' && gpioSubPin == ''){
    global.set("errorCase", 'gpioSubSelectError');
    objectData = 'GPIO Second Pin unselected';

} else if (connectionType == 'L:' && loraId == ''){
    global.set("errorCase", 'loraIdMissingError');
    objectData = 'LoRa id is undefined';

} else if (connectionType == 'L:' && loraRelayNo == ''){
    global.set("errorCase", 'loraRelayNoMissingError');
    objectData = 'LoRa relay number is undefined';

} else {
    global.set("errorCase", 'noError');
    if (connectionType == 'G:'){
        if (deviceList == 'F:'){
            objectData = usage + deviceList + powerSource + fanType + minus + connectionType + gpioPin + minus + deviceTag;
        } else if (deviceList == 'M:') {
            objectData = usage + deviceList + driveTime + twoDot + powerSource + minus + connectionType + gpioPin + gpioSubPin + minus + deviceTag;
        } else {
            objectData = usage + deviceList + powerSource + minus + connectionType + gpioPin + minus + deviceTag;
        }
    } else if (connectionType == 'L:') {
        if (deviceList == 'F:') {
            objectData = usage + deviceList + powerSource + fanType + minus + connectionType + loraId + loraRelayNo + minus + deviceTag;
        } else if (deviceList == 'M:') {
            objectData = usage + deviceList + driveTime + twoDot + powerSource + minus + connectionType + loraId + loraRelayNo + minus + deviceTag;
        } else {
            objectData = usage + deviceList + powerSource + minus + connectionType + loraId + loraRelayNo + minus + deviceTag;
        }
    }
}

global.set("objectData", objectData);
